        <div className="feels">
          <p className="bold">65°F</p>
          <p>Feels Like</p>
        </div>
        <div className="humidity">
          <p className="bold">20%</p>
          <p>Humdity</p>
        </div>
        <div className="wind">
          <p className="bold">20 MPH</p>
          <p>Wind</p>
        </div>
      </div>
    </div>
  );
}

export default App;
